  return (
    <div>
      <img src="./public/01.jpg" alt="รูปภาพ" width="200" height="150"></img>
      <h1>Hey Welcome</h1>
      <br /><h6>while you sit and stay - we’ll go out and play</h6><br />
      <p>
        <a href="/login">get started</a>
      </p>
      {/* แสดงหน้า Login, Register ตาม route */}
      <Outlet />
    </div>
  );
}

export default App;
